(1, 1, 'Webihooks', 'Webihooks is a Trusted Web Solutions Partner in Mumbai. We specialize in creating innovative, scalable, and user-friendly websites to help businesses thrive in the digital world.', '1404, Building No.2, Vasudev Sky High, Mira road - East', 'https://maps.app.goo.gl/szPP3AAG1YEtuj9f7', '2025-03-25 19:14:10', '2025-03-27 12:16:06', 'Director'),
(2, 1, 'WorkEthics', 'WorkEthics is a Trusted Web Solutions Partner in Mumbai. We specialize in creating innovative, scalable, and user-friendly websites to help businesses thrive in the digital world.', 'Silver Park, Mira Road, East', 'https://goo.gl/maps', '2025-03-27 14:29:00', '2025-03-27 14:29:00', 'Partner'),
(3, 3, 'Fashion Shop', 'This is Clothing shop for gent, ladies and children.', 'Shop No.5, Beverly Park, Mira Road', 'https://maps.app.goo.gl/8SB9oUMTmsyedZaRA', '2025-03-31 20:15:23', '2025-03-31 20:15:23', 'Owner'),
(4, 4, 'Momo King', 'Slat And Pepper Restaurant is a paradise for momo lovers, offering a delightful fusion of authentic Himalayan flavours and modern culinary twists. Known for its fresh, hand-crafted dumplings, the restaurant serves a variety of momos, including steamed, fried, and tandoori options, filled with delicious meats, vegetables, and exotic spices. Alongside momos, the menu features a selection of Tibetan, Nepalese, and Indo-Chinese dishes, ensuring a rich and flavorful dining experience. With a warm and inviting ambiance, Momo King is the perfect spot for food enthusiasts looking to savour the best of Himalayan street food in a cozy setting.', 'Shop 04, Building-S- 5, Jangid Tower, Shanti Park, Near Syndicate Bank, Mira Road, Mumbai.', 'https://g.co/kgs/18T5Pqd', '2025-04-03 12:22:45', '2025-05-01 14:44:19', 'Owner'),
(5, 5, 'Khushamadeed Restaurant', 'Khushamadeed Restaurant, located in Mira Road East, Mumbai, offers a delightful culinary experience with its authentic North Indian and Mughlai cuisine. The menu features a variety of flavorful dishes, including Mutton Nihari, Mutton Biryani, Chicken Biryani, Chicken Burra Punjabi, Chicken Afghani, and the traditional Khameeri Roti. The restaurant provides a warm and inviting ambiance, making it an ideal spot for family gatherings, casual outings, or intimate dinners. With a focus on traditional flavors and quality ingredients, Khushamadeed ensures a memorable dining experience for all patrons.', 'Gala No. 8, 9, 10, Arciadia, Jangid Enclave, Kanakia Rd, Opp. Laxmi Park, Unique Gardens, Gaurav City, Mira Road - East', 'https://maps.app.goo.gl/v99yf1eoBdudzBcS8', '2025-04-12 09:32:05', '2025-04-12 09:34:34', 'Owner'),
(6, 7, 'Company Name', 'This is the testing description for this page. We have adding paragraph for testing.', '1404, Building No.2, Vasudev Sky High, Mira Road - East, Thane - 401107', 'https://maps.app.goo.gl/szPP3AAG1YEtuj9f7', '2025-04-21 12:18:21', '2025-04-21 12:18:21', 'Owner'),
(7, 11, 'Tasty Point Chinese Restro', 'Kitchen Cafe & Restro is a cozy and vibrant spot offering a delightful blend of café charm and restaurant comfort. Enjoy freshly brewed coffee, delicious snacks, and a variety of mouth-watering meals in a relaxed and inviting atmosphere—perfect for casual hangouts or hearty dining.', 'Shop No.5, Laxmi Plaza, S.V.Road, Bandra - East, Mumbai - 400065', 'https://maps.app.goo.gl/CHY4j1hBXDdDp32D8', '2025-05-01 19:23:18', '2025-05-04 09:08:20', 'Manager'),
(8, 15, 'Gold Coin Restaurant', 'A beloved culinary landmark in Mira Road since 1994, Gold Coin Restaurant serves delicious, authentic Indian and Chinese cuisine in a warm, family-friendly ambiance. Known for its flavorful dishes, generous portions, and timeless taste, it remains a favorite dining destination for locals and visitors alike.', 'Sheetal Darshan Building Sheetal Nagar Naka, Mira Road East, Maharashtra 401107', 'https://maps.app.goo.gl/nh2vTUJ2tuhmm2kE8', '2025-05-23 10:38:01', '2025-05-23 13:00:29', 'Owner'),
(9, 16, 'Krishna Lunch Home', 'Krishna Lunch Home in Mira Road offers authentic Mangalorean seafood and North Indian dishes at budget-friendly prices. Known for its flavorful thalis, chicken sukka, and neer dosa, it\'s a local favorite.', 'Shop No-1 & 2, Sheetal Kunj, behind Snehanjali, Sheetal Nagar, Mira Road East, Mira Bhayandar, Maharashtra 401107', 'https://maps.app.goo.gl/rAhzxZFW6NRfQv5J6', '2025-05-24 11:20:57', '2025-05-24 11:30:21', 'Owner'),
(10, 17, 'Swadisht Rasoi', 'Swadisht Rasoi Restaurant offers a delightful fusion of authentic Indian and flavorful Chinese cuisine, with a wide range of both vegetarian and non-vegetarian dishes. From rich curries and sizzling tandoori to spicy noodles and stir-fries, every dish is prepared with fresh ingredients and traditional spices. Whether you\'re craving North Indian classics or Indo-Chinese favorites, Swadisht Rasoi promises a satisfying dining experience for every palate.\r\nTiming: 12 PM - 4 PM and 6 PM to 12:30 AM ', 'Shop No.05, Sai Arcade, Indralok Phase 3, Bhayandar East, Mumbai, Mira Bhayandar, Maharashtra 401105', 'https://maps.app.goo.gl/Y8GrZx4qkb5YHMEv9', '2025-06-01 10:51:13', '2025-06-01 11:11:52', 'Owner'),
(11, 18, 'Test test', '', 'Gfgh', '', '2025-06-05 14:52:15', '2025-06-05 14:52:15', ''),
(12, 18, 'The great china', '', 'Mira rd', '', '2025-06-05 15:08:33', '2025-06-05 15:08:33', ''),
(13, 19, 'New Shahi Family Restaurant', 'A warm, family-friendly dining spot in Mira Road (East), serving authentic North Indian, Mughlai, Chinese, and kebab favorites since 2006. Known for its generous portions, cozy décor, and welcoming staff, it’s perfect for large groups, weekend dinners, or casual get-togethers—with tasty mocktails and a budget-friendly menu around ₹650–950 for two. ', 'Shop No.1, 2.3.4, Mira Bhayandar Rd, Medetiya Nagar, Queens Park, Mira Road East, Mira Bhayandar, Maharashtra 401107', 'https://maps.app.goo.gl/Yvk7mVPdgnnGsbmU6', '2025-06-09 10:56:05', '2025-06-09 10:56:05', 'Owner'),
(14, 20, 'Shree Krishna Pure Veg Restaurant', 'Shree Krishna Pure Veg Restaurant in Bhayandar serves authentic vegetarian food with South Indian, North Indian, and Chinese options. Enjoy clean ambiance, quick service, and tasty meals at affordable prices.', 'Shop no. 1,2,3, C Wing, Durga Residency, Annapurna Estate, IV Indralok, Deepak Hospital Road, Bhayandar East, Thane-401105', 'https://maps.app.goo.gl/Z9rukSWDG5Urx24DA', '2025-06-10 08:41:39', '2025-06-11 12:35:18', ''),
(15, 21, 'Shahi Restaurant', 'Shahi Restaurant in Mira Road serves rich Mughlai, North Indian, and Chinese delicacies with bold flavors, generous portions, and a royal dining experience for families and food lovers alike.\r\nDelivery Charges: ₹10,₹20,₹30. \r\nDelivery within 5kms.', 'M.T.N.L Road, Sheetal Sai, Sheetal Nagar, Mira Road, Thane-401107', 'https://maps.app.goo.gl/Btn9MLTyDcVRkKir9', '2025-06-12 07:04:53', '2025-06-28 09:33:38', ''),
(16, 22, 'Shree Krishna Pure Veg', 'Shree Krishna Pure Veg Restaurant in Bhayandar serves authentic vegetarian food with South Indian, North Indian, and Chinese options. Enjoy clean ambiance, quick service, and tasty meals at affordable prices.', ' Shop no. 1,2,3, C Wing, Durga Residency, Annapurna Estate, IV Indralok, Deepak Hospital Road, Bhayandar East, Thane-401105', 'https://maps.app.goo.gl/Z9rukSWDG5Urx24DA', '2025-06-12 12:27:48', '2025-06-12 12:27:48', ''),
(17, 23, 'Sigdi Restaurant', 'Located in Oswal Point (A wing) on Kanakia Road, Sigdi offers a lively casual-dining experience, perfect for families and groups. The menu spans Mughlai, North Indian, Chinese, seafood and biryani specialties, with hearty kebabs, Tandoori delights, Schezwan dishes and even ice creams. It’s known for bold, fusion-style flavors—ideal for a robust meal in a friendly, relaxed setting. With average cost for two around ₹800‑950, it supports both dine-in and delivery, and stays open into the evening .', 'Laxmi Park, SHOP NO.8, Oswal Point, A wing, Kanakia Rd, opposite Park View Hotel, Mira Road East, Mira Bhayandar, Maharashtra 401107', 'https://maps.app.goo.gl/zrdjvo5x5s7RxmQP8', '2025-06-12 16:07:33', '2025-07-15 09:58:23', 'Owner'),
(18, 24, 'Charlie\'s Chimney', 'Charlie\'s Chimney in Mira Road serves bold Indo-Chinese and fusion flavors, sizzling starters, hearty rice bowls, Korean specials, and unique Asian platters in a vibrant, modern, and family-friendly setting.', 'Shop NO 8, 9 & 11 ,Ostwal Kiran CHS Ltd, Opposite Old Petrol Pump, Mira Bhayandar Road, Mira Road East', 'https://maps.app.goo.gl/6vQYJHSnHvJxFbg38', '2025-06-16 10:50:03', '2025-06-16 14:40:47', ''),
(19, 25, 'Prime Fast Food', 'Prime Fast Food, Mira Road serves delicious fast food, snacks, and refreshing juices. Enjoy crispy bites, flavorful treats, and fresh beverages in a quick, friendly, and hygienic setting', 'Shop No. 11 Cinemax Prime Mall, Kanakia Road, Mira Road East, Thane 401107', 'https://maps.app.goo.gl/LWijBCJGd18FJ7MV7', '2025-06-16 15:43:24', '2025-06-24 13:01:41', ''),
(20, 26, 'Shivali Garden', 'Shivali Garden in Mira Road offers a warm, garden-themed casual dining experience. Enjoy North Indian, Chinese & Sichuan dishes like butter prawns and paneer crispy. Ideal for families, friendly ambiance, valet parking.', 'Shivali Garden, Shanti Park, Near Gokul Village, Mira Road East, Thane-401107', 'https://maps.app.goo.gl/miDApSPdnLH2psMV7', '2025-06-17 10:15:06', '2025-06-23 07:23:06', ''),
(21, 28, 'Biryani By Bulk', 'Biryani by Bulk offers rich, aromatic biryanis made with premium ingredients—perfect for parties, events, and celebrations. Enjoy generous portions, authentic flavors, and hassle-free service for every gathering.', 'Shop no 2, Sheetal Raj Complex, Sheetal Nagar', 'https://maps.app.goo.gl/M4tn9etSXH425jr67', '2025-06-23 08:32:52', '2025-07-24 13:09:46', ''),
(22, 30, 'Hollywood Bollywood Restaurant', 'Hollywood Bollywood Restaurant, Mira Road blends cinematic charm with flavorful cuisine. Enjoy North Indian, Chinese, and tandoori dishes in a vibrant ambiance inspired by Bollywood and Hollywood glamour.', 'Jai Shree Krishna Darshan C, Shop Number 8,9, Hatkesh Rd, opposite RITU PARADISE PHASE-1, Phase 1, Gaurav Sankalp, Mira Road East, Maharashtra 401107', 'https://maps.app.goo.gl/XZizKPyBm28AmoAD6', '2025-06-24 13:18:13', '2025-06-24 13:18:13', ''),
(23, 31, 'Bijay Chinese Corner', 'Bijay Chinese Corner, Bhayandar serves flavorful and affordable Indo-Chinese dishes. From spicy noodles to crispy starters, enjoy quick, tasty street-style Chinese food that’s perfect for casual dining and takeaways.', 'Gala No.3/4, Village Goddev Naka, Navghar Rd, Nr. Kapol Bank, Bhayandar East, Mira Bhayandar, Maharashtra 401105', 'https://maps.app.goo.gl/qWUHXSUxYGgdJS1c6', '2025-06-24 13:37:29', '2025-06-24 13:37:29', ''),
(24, 32, 'Shree Krishna Pure Veg Restaurant', 'Serving delicious vegetarian meals, Shree Krishna Pure Veg Restaurant in Navghar Bhayandar offers South Indian, Punjabi, Chinese, snacks, and fast food in a clean, family-friendly atmosphere.', 'Shop No 1, CHS LTD, Jay Vandana, Navghar Rd, Bhayandar, Bharat Nagar, Bhayandar East, Mira Bhayandar, Maharashtra 401105', 'https://maps.app.goo.gl/2fprVxLnV25WR5F57', '2025-06-25 15:49:53', '2025-06-25 15:57:17', ''),
(25, 34, 'Shree Krishna Pure Veg Restaurant Dining', 'Serving delicious vegetarian meals, Shree Krishna Pure Veg Restaurant in Navghar Bhayandar offers South Indian, Punjabi, Chinese, snacks, and fast food in a clean, family-friendly atmosphere.', 'Shop No 1, CHS LTD, Jay Vandana, Navghar Rd, Bhayandar, Bharat Nagar, Bhayandar East, Mira Bhayandar, Maharashtra 401105', 'https://maps.app.goo.gl/2fprVxLnV25WR5F57', '2025-06-26 17:59:28', '2025-06-26 17:59:28', ''),
(26, 35, 'Shree Krishna Lunch Home', 'Shree Krishna Lunch Home on Deepak Hospital Road, Mira Road, serves delicious, homely Indian meals with authentic flavors, quick service, and affordable prices—perfect for lunch and dinner cravings.', 'Shop No. 10-11, Shree Ambika Complex,\r\nMedatiya Nagar, Phase-1, Near Seven Square Academy,\r\nDeepak Hospital Road, Mira-Bhayander,\r\nMira Road (E), Thane - 401 107.', 'https://maps.app.goo.gl/o6oJhveGLEZLhE6r6', '2025-06-27 07:04:57', '2025-06-30 17:00:12', ''),
(27, 36, 'Shree Balaji Restaurant', 'Shree Balaji Restaurant Bhayandar offers a wide vegetarian menu including Indian, Chinese, and Continental dishes, known for tasty food, family-friendly ambiance, quick service, and affordable prices.', 'Shop No. 1, Balaji Complex, Bhayandar Flyover, near Walchand Ashish Building, Bhayandar West, Mira Bhayandar, Maharashtra 401101', 'https://maps.app.goo.gl/mHuEMYMgLranFnFn7', '2025-06-27 14:03:29', '2025-07-01 12:43:01', ''),
(28, 40, 'Shree Krishna Lunch Home Dinning', 'Shree Krishna Lunch Home on Deepak Hospital Road, Mira Road, serves delicious, homely Indian meals with authentic flavors, quick service, and affordable prices—perfect for lunch and dinner cravings.', 'Shop No. 10-11, Shree Ambika Complex,\r\nMedatiya Nagar, Phase-1, Near Seven Square Academy,\r\nDeepak Hospital Road, Mira-Bhayander,\r\nMira Road (E), Thane - 401 107.', 'https://maps.app.goo.gl/o6oJhveGLEZLhE6r6', '2025-06-30 16:58:53', '2025-06-30 17:00:21', ''),
