(31, 44, 'New Delhi Zaika', 'New Delhi Zaika Muradabad Chicken Biryani Centre in Mira Road serves flavorful, authentic Muradabadi-style chicken biryani—rich spices, tender meat, and aromatic rice that captures true North Indian taste.', 'Shop 17, Green Avenue, , Near St. Xavier School, , Shanti Park, Mira Road East-401107', 'https://maps.app.goo.gl/hW8hz8Mh1LUNMxQT7', '2025-07-16 07:56:49', '2025-07-16 07:58:09', 'Muradabad Chiken Biryani Centre'),
(32, 46, 'The Myriad Hotel', 'The Myriad Hotel on Mira Road East offers comfortable, modern rooms with free Wi‑Fi, on‑site restaurants including a lounge bar and banquet hall, plus amenities like valet parking and 24/7 service.', 'The Myriad Hotel, Opp. Indian Petrol Pump, Mira Road - East, Thane - 401107.', 'https://maps.app.goo.gl/9b25ZAueWEX4FYjW9', '2025-07-22 10:49:06', '2025-07-22 14:19:55', ''),
(33, 47, 'The Myriad Hotel', 'The Myriad Hotel offers a diverse culinary experience all under one roof — from the authentic flavors of Urban Dhaba, to fresh Coastal Seafood, and vibrant vibes at The Winking Owl lounge & bar.\r\nEnjoy a variety of tastes and cuisines, crafted to satisfy every craving.', ' The Myriad Hotel, Opp. Indian Petrol Pump, Sai baba nagar, Mira Road - East, Thane - 401107.', 'https://maps.app.goo.gl/9b25ZAueWEX4FYjW9', '2025-07-22 14:15:34', '2025-07-26 13:53:31', ''),
(34, 48, 'Hotel Prabhuleela', 'Hotel Prabhuleela in Bhayandar West offers homestyle vegetarian meals, cozy seating, and quick service. Known for thalis, curries, and rice dishes, ideal for casual dining. Delivery within 5kms  Charges: 10,20,30', 'Arihant Krupa, Opp. Khau Galli, Station Road, Bhayander (West), Thane - 401101', 'https://maps.app.goo.gl/xGKCkhnRarYcXAgAA', '2025-07-23 09:35:33', '2025-07-25 14:07:09', ''),
(35, 50, 'Chinese Hub Pure Veg Family Restaurant', 'A pocket‑friendly vegetarian Chinese spot in Mira Road, Mumbai, this modest eatery (Shop 9, New Bharati Tower, Plesant Park) offers quick service and generous portions at around ₹350 for two', 'Shop no 9, Bharati Tower, Pleasant Park, Mira Road - East, Mira Bhayandar, Maharashtra 401107', 'https://maps.app.goo.gl/9PvZ62VmtJhR6SEx9', '2025-07-29 07:24:13', '2025-07-30 08:31:10', ''),
(36, 51, 'Ashish Family Bar and Restaurant', 'Ashish Family Bar and Restaurant in Bhayander offers a cozy dining experience with delicious multi-cuisine dishes, refreshing drinks, and a welcoming ambiance perfect for families and friends alike.', 'Sai Yogeshwar Apartment, Navghar Phatak Road, Bhayandar East, Mumbai, 401105', 'https://maps.app.goo.gl/iXUBVSG9ZMMAj2Tp6?g_st=ipc', '2025-07-29 11:49:14', '2025-08-06 15:32:36', ''),
(37, 54, 'Kurshid Used Biikes Store', 'Kurshid Used Bike Store in Nallasopara West offers quality second‑hand motorcycles with transparent pricing, reliable servicing, and personalized customer care. Ideal for budget-conscious riders seeking dependable rides and friendly advice.', 'Samel pada, Nallasopara west', '', '2025-07-31 10:28:06', '2025-07-31 10:28:06', ''),
(38, 55, 'Aao Khao Chinese Biryani Pulav', 'Aao Khao Chinese Biryani Pulav – located in Kashimira, Mira Road East – serves flavorful fusion delights of Chinese cuisine with aromatic biryani and pulav. We take party orders also!', 'Shop No.13, Opp Shri Chhatrapati Shivaji Maharaj Statue, Next To Sunrise Hotel, Mira Bhayander Road, Kashimira, Mira Road E.Thane 401107', 'https://maps.app.goo.gl/s2z8tja7A6ncD3Kx9', '2025-08-01 13:58:21', '2025-08-01 13:58:21', ''),
(39, 56, 'Shawarmazing', 'Delight in authentic Middle Eastern shawarmas, loaded with juicy meats, fresh veggies, and signature sauces. A perfect spot for bold flavors and satisfying wraps, right in Mira Road', 'Shop no. 1 , Mira Plaza , Mira - Bhayandar Rd, Hatkesh Rd, Mira Road East, Thane, Maharashtra 401107', 'https://maps.app.goo.gl/CdnnhiyjZviH9X2k8', '2025-08-02 09:34:29', '2025-08-02 09:34:29', ''),
(40, 57, 'Moradabadi and Hyderabadi Famous Chicken Biryani', 'Moradabadi and Hyderabadi Famous Chicken Biryani in Mira Road serves two iconic biryani styles—spicy Hyderabadi and flavorful Moradabadi, cooked with tender chicken, aromatic rice, and rich traditional masalas.', 'Shop 2, New Salasar Orchid CHS, New Green Court Club, Mira Road, Mira Bhayandar, Maharashtra, 401107', 'https://maps.app.goo.gl/aBVy1p3vuwwwaAnK7', '2025-08-02 12:47:51', '2025-08-02 14:08:20', '');
