(24, 15, 'Naved Shaikh', 'naved@gmail.com', '9876543210', 5, 'Gold Coin has been our go-to restaurant for years! Their Schezwan Fried Rice and Chilli Chicken are unbeatable. The taste is consistently amazing, and the service is always warm. A true gem since 1994!', '2025-05-23 13:04:01'),
(25, 15, 'Priya Shah', 'priya@gmail.com', '9876543210', 5, 'From their crispy Spring Rolls to the rich Butter Chicken, every dish feels like it’s made with love. The staff remembers our orders, and the food quality has never dropped in all these years. Highly recommend!', '2025-05-23 13:04:46'),
(26, 15, 'Rajesh Deshmukh', 'rajesh@gmail.com', '9876543210', 5, 'I’ve been coming here with my parents since I was a kid, and now I bring my own family. Gold Coin’s food is nostalgia on a plate—consistent, delicious, and worth every bite!', '2025-05-23 13:06:09'),
(27, 16, 'Mangesh Shetty', 'mangesh@gmail.com', '9876543210', 5, 'The fish thali was absolutely delicious! Fresh, flavorful, and great value for money. I’ll definitely come back with my family.', '2025-05-24 11:32:21'),
(28, 16, 'Priyaka Patil', 'priya@gmail.com', '9876543210', 5, 'Authentic taste and homely vibe! The neer dosa with chicken sukka is a must-try. Service is quick and courteous too.', '2025-05-24 11:33:00'),
(29, 16, 'Javed Shaikh', 'javed@gmail.com', '9876543210', 5, 'A hidden gem in Mira Road! The Mangalorean dishes took me back home. Loved the hygiene, portion size, and taste. Highly recommended!', '2025-05-24 11:33:40'),
