(42, 25, 'Rohit Sharma', 'rohit@gmail.com', '9876543210', 5, 'Prime Fast Food is my go-to place for quick snacks and juices. The food is always fresh, tasty, and served with a smile. Great value for money too!', '2025-06-24 13:02:43'),
